import React from 'react'
import mainback from './mainback.jpeg'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container} from "react-bootstrap";
export default function Banner() {
    return (
        <div class="main">
            <div class="main_img">
            <img src={mainback} style={{"width":"100%","height":"30%"}} alt="" />
            </div>

                <Container>

            Your NFT, Give Life to it.
            MM802 SSRD is the Software which gives life to your NFT by engraving it on objects
            </Container>


            </div>
    )
}
